window.bookSummaryJSON = "<p><b>Annika Knowles knows better than to get involved with powerful men. She nearly became collateral damage in a war once before, but she ran, making a new life for herself in the seedy underbelly of Las Vegas.</b></p> <p>The High Roller Club offers someone with her skill set the chance to make her own way, and she's mostly managed to keep her head down. Well, if you don't count how she keeps falling into bed with one of the club's security specialists. Or how she accidentally caught the eye of one of the most dangerous men in Vegas. And we won't even get started on the way his ruthless enforcer watches her every time she enters a roomâ€¦</p> <p>Actually, she's terrible at lying low.</p> <p>But all of these problems are easily managed.</p> <p>What isn't? Severing the ties to her old life.</p> <p>Can Annika's new allies keep her safe? Or will she have to cut and run again, losing everything she's built for herself in the process?</p> <p><i>This is a standalone set in the High Roller Omegas shared world. In Annika's story, you'll find no cheating, no choosing, and a pack of dangerous men who fall first.</i></p>"; 
